Incorrect type of `bisector`'s `left` and `right`. 
According d3 [API reference](https://github.com/mbostock/d3/wiki/Arrays#d3_bisector), one can use `bisector` like this:

``` JS
var data = [
  {date: new Date(2011, 1, 1), value: 0.5},
  {date: new Date(2011, 2, 1), value: 0.6},
  {date: new Date(2011, 3, 1), value: 0.7},
  {date: new Date(2011, 4, 1), value: 0.8}
];
var bisect = d3.bisector(function(d) { return d.date; }).right;
bisect(data, new Date(2011, 1, 2));
```

So the second parameter has the same type of the return type of `accessor`.

The other overload of `bisector` is correct.

In the angular [$q documentation](http://docs.angularjs.org/api/ng/service/$q) the usage is:

``` javascript
function asyncGreet(name) {
  // perform some asynchronous operation, resolve or reject the promise when appropriate.
  return $q(function(resolve, reject) {
    setTimeout(function() {
      if (okToGreet(name)) {
        resolve('Hello, ' + name + '!');
      } else {
        reject('Greeting ' + name + ' is not allowed.');
      }
    }, 1000);
  });
}
```

The keyword `new` is not used.

Proposed fix for #4740 - "Node's `require` should implement a new interface `NodeRequire` (rather than direct signature) for specialized extension by other libraries"

usage example extending `require()` with a specialized overload for `'browser-window'`:

```
interface NodeRequireFunction {
    (id: 'browser-window'): { new (options?: GitHubElectron.BrowserWindowOptions) : GitHubElectron.BrowserWindow }
}

// ...

mainWindow = new BrowserWindow({ width: 800, height: 600 });
```

and now Typescript correctly knows the types of the identifiers.
